import React, { Component } from 'react'
import './Title.css'
import myCourseWorkData from '../Content/activeWorkData'
import completedWorksData from '../Content/completedWorksData'
import { isNumber } from 'util';

interface Props{
    page? : string
}

interface State{
}

class Title extends Component<Props,State>{
    constructor(props:Props){
        super(props);
        this.state = {
        }
    }

    private whichTitle(){
        if(this.props.page === 'Моя курсовая детально')
            return myCourseWorkData[0].title
        else if (isNumber(this.props.page))
            return completedWorksData[Number(this.props.page)].title
        else return this.props.page
    }


    render(){
    return(
        <div className='title'>
            <p className='title-text'>{this.whichTitle}</p>
            <hr/>
        </div>

    )
    }
}

export default Title
